import React from "react";
import { Box, Container, Grid } from "@mui/material";

export const Logo = ({ logo }) => {
  return (
    <Box
        component={'div'}
        display={'flex'}
        alignItems={'center'}
    >
        <h1>Hola</h1>
      <img src={logo} height={"auto"} width={"auto"} alt="logoUdeA" />
    </Box>
  );
};
